import React from 'react';
import Grid from "@mui/material/Grid";

export default function Login() {
    return (
    <Grid 
        container spacing={0} 
        direction="column"
        alignItems="center"
        justifyContent="center"
        sx={{ minHeight: '100vh'}}
    >
        <form>
            <label>
                Email:
                <input type="text" name="email" />
            </label>
            <label>
                Password:
                <input type="text" name="password" />
            </label>
            <input type="submit" name="submit button" />
        </form>
    </Grid>

    );
}
